import { useMemo } from "react";
import StyleLight1 from "./StyleLight1";
import StyleHomeModeLight from "./StyleHomeModeLight";
import Property1Disable2StyleLi from "./Property1Disable2StyleLi";
import "./StyleLight.css";
const StyleLight = ({
  refresh,
  frame13,
  google,
  extension,
  logos,
  instacartGroceryDeliveryO,
  logos1,
  logos2,
  logos3,
  tabs,
  showLogosIcon,
  showTabs,
  tabsVisible,
  showTabsIcon,
  styleLightWidth,
  styleLightPosition,
  styleLightTop,
  styleLightLeft,
  tabWidth,
  tabRight,
  tabLeft,
  vectorIconTop,
  vectorIconBottom,
  vectorIconTop1,
  vectorIconBottom1,
}) => {
  const styleLightStyle = useMemo(() => {
    return {
      width: styleLightWidth,
      position: styleLightPosition,
      top: styleLightTop,
      left: styleLightLeft,
    };
  }, [styleLightWidth, styleLightPosition, styleLightTop, styleLightLeft]);

  const tabStyle = useMemo(() => {
    return {
      width: tabWidth,
      right: tabRight,
      left: tabLeft,
    };
  }, [tabWidth, tabRight, tabLeft]);

  const vectorIconStyle = useMemo(() => {
    return {
      top: vectorIconTop,
      bottom: vectorIconBottom,
    };
  }, [vectorIconTop, vectorIconBottom]);

  const vectorIcon1Style = useMemo(() => {
    return {
      top: vectorIconTop1,
      bottom: vectorIconBottom1,
    };
  }, [vectorIconTop1, vectorIconBottom1]);

  return (
    <div className="stylelight" style={styleLightStyle}>
      <StyleLight1
        styleLightPosition="absolute"
        styleLightTop="0px"
        styleLightLeft="0px"
      />

      <div className="tabs-parent">

        <div className="tabs">
          <img className="vector-icon1" alt="" src="/undefined40.png" />
          <div className="logo">
            <img className="logos-icon" alt="" src={logos1} />
            <div className="new-tab">New Tab</div>
          </div>
          <img className="icons" alt="" src="/undefined42.png" />
        </div>
        {showTabs && (
          <div className="tabs">
            <img
              className="vector-icon1"
              alt=""
              src="/undefined37.png"
              style={vectorIconStyle}
            />

            <img className="icons1" alt="" src="/undefined39.png" />
            <img className="tabs-child" alt="" src="/undefined44.png" />
          </div>
        )}
        {tabsVisible && (
          <div className="tabs">
            <img
              className="vector-icon1"
              alt=""
              src="/undefined37.png"
              style={vectorIcon1Style}
            />

            <img className="icons1" alt="" src="/undefined39.png" />
            <img className="tabs-child" alt="" src="/undefined44.png" />
          </div>
        )}
        {showTabsIcon && <img className="tabs-icon" alt="" src={tabs} />}
      </div>
    </div>
  );
};

export default StyleLight;
